import React, { useState, useEffect } from "react";
import axios from "axios";

const UsersList = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:2323/users/users")
      .then((res) => setUsers(res.data))
      .catch((err) => console.log(err));
  }, []);

//   const deleteUser = (id) => {
//     axios
//       .delete(`http://localhost:2323/users/users/${id}`)
//       .then(() => setUsers(users.filter((user) => user.id !== id)))
//       .catch((err) => console.log(err));
//   };

  return (
    <div>
      <h1>User List---</h1>
      {users ? (
        <>
          <p>data recived</p>
          <div>
            {users.map((i) => (
              <div className="border-dark border m-1 container">
                <p className="m-0 p-0">ID: {i.id}</p>
                <p className="m-0 p-0">Name: {i.name}</p>
                <p className="m-0 p-0">Age: {i.studentAge}</p>
                <p className="m-0 p-0">Marks: {i.studentMarks}</p>
              </div>
            ))}
          </div>
        </>
      ) : (
        <></>
      )}
    </div>
  );
};

export default UsersList;
